INSERT INTO `course` VALUES (1496,'COMPRO1','This course covers the fundamentals of logic formulation and computer programming using the C programming language. It serves as a foundation for future courses that the students will encounter throughout the Computer Science program. This course is coupled with a lab component.','Introduction to Computer Programming 1',3,2,12),(1499,'COMPRO2','This advanced course for computer programming in C covers the representation and manipulation of C data structures. This course, like COMPRO1, serves as a foundation for future courses that the students will encounter throughout the Computer Science program. This course is coupled with a lab component.','Advanced C Programming',3,2,12),(1500,'OBJECTP','This course provides the students with the fundamental understanding of object-oriented technology.  It also introduces the different concepts that are commonly associated with object-oriented programming such as threading, event-driven programming, etc. using Java as the programming language.','Object-oriented Programming using Java',3,2,12),(1501,'INTRODB','The course covers the basic theories behind databases, data models and database analysis and design. The course will tackle different data models but will concentrate mainly on relational databases, being the most commonly used today.  The course introduces learners to concepts on conceptual design of databases using the concepts of the Entity-Relationship (ER) model and normalization, relational model, relational database design and database query languages. ','Introduction to Databases',3,2,12),(1502,'ADVANDB','This course is about major advanced concepts in the field of databases. Being an advanced course, it will involve a considerable amount of research work as embodied by the projects required to complete the course.','Advanced Database',3,2,12),(1503,'SWDESPA','This is an advanced programming course emphasizing object-oriented design. Design patterns are recurring solutions in designing systems and are considered simple yet elegant solutions which have been proven effective over time. The applications of these design patterns allow the creation of systems that are more scalable, reliable and effective. ','Software Design Patterns',3,2,12),(1504,'WEBAPDE','This course introduces students to the theories, processes and skills needed in the development of web applications. It provides an overview of the various technologies used in designing and implementing web-based systems. Advanced topics are also included to prepare students in realizing useful web applications that utilize up-to-date industry tools.','Web Applications Development For ST',3,2,12),(1505,'SOFENGG','This course provides an overview of software engineering as a discipline concerned with the application of theory, knowledge, and practice for effectively and efficiently building software systems. It introduces the students to the fundamental principles and methodologies of software engineering.  It focuses on the concepts and principles of software requirements engineering, its tools, techniques, and methods for modeling software systems. Various approaches to requirements analysis and review activities are examined.','Introduction to Software Engineering',3,2,12),(1506,'SECURDE','This course introduces the students to the concepts and principles surrounding secure coding practices and software security assessment. Students will be taught how to properly assess threats that may present a risk to software, web applications in particular, and how to mitigate these threats by incorporating appropriate controls through the software development life cycle. The course will also cover the methodologies and tools used to test existing web applications.','Secure Web Development',3,2,12),(1507,'PROSDEV','The aim of this course is to prepare ST students for practicum and a career in software development by delivering actual knowledge and skills currently required by the industry. This is achieved through lectures from IT industry practitioners on the current trends and organizational practices that lead to producing software that is robust, reliable and attractive to use, often co-operating with others as part of a development team. ','Professional Software Development',3,2,12),(1508,'PRC-ST1','This course is the venue for Software Technology upperclassmen to apply and practice the Computer Science concepts and theories they have learned, by working in an actual company environment.','Practicum Course in ST',1,2,12),(1509,'MOBAPDE','In this course, we will look into the technical capabilities and challenges of developing for mobile platforms for practical usage in the IT industry. The course would also look into ways of integrating such devices into the industry supply chain and the issues it raises.','Mobile Computing',3,2,12),(1510,'CCSALGE','This is a course tackling basic algebra for Computer Science Students. Topics include the number systems, algebraic expressions, fractions, rational exponents, linear and quadratic equations and inequalities, systems of equations, lines , linear and quadratic functions and inverse function,','College Algebra for CCS Students ',2,5,26),(1511,'CCSTRIG','This course covers polynomial functions, exponential and logarithmic functions, trigonometric functions, inverse trigonometric functions, solutions of triangles, law of sine and law of cosine','Trigonometry for Computer Science Majors ',2,5,26),(1512,'CCSCAL1','This course covers basic concepts of plane analytic geometry, limits and continuity, derivatives and their applications.','Calculus 1 for CCS Students',3,5,26),(1513,'CCSCAL2','This second course in analysis covers differentiation and integration of exponential, logarithm and trigonometric functions; the concepts of the definite and indefinite integral and some applications of the definite integral.','Calculus 2 for CCS Students',3,5,26),(1514,'DISCTRU','This is a one-term introductory course in Discrete Mathematics. Topics include, but not limited to: prepositional and predicate logic, set theory, relations and functions, integers and algorithms, proof rules and program correctness, mathematical reasoning, recurrences. ','Discrete Structures',3,2,12),(1515,'DASALGO','This is a introductory course in Data Structures and Algorithms. Topics include, but not limited to: representation and operations on linear and non-linear data structures (arrays, lists, stacks, queues, graphs, trees, heaps), applications of data structures, types of file organizations, hashing, and analysis of algorithms. ','Introduction to Data Structure and Algorithm',3,2,12),(1516,'INTESYS','This course introduces the students to the basic concepts and techniques in the area of artificial intelligence. Concepts and techniques include knowledge representations, searching and problem solving. Furthermore, the course is designed to expose undergraduate students to functional and symbolic programming and use of an expert system shell.','Intelligent Systems',3,2,12),(1517,'ALGOCOM','This course covers the design and analysis of different algorithms under various design principles and techniques making use of different data structures.','Algorithm Complexity',3,2,12),(1518,'AUTOMAT','This course concentrates on the theoretical aspect of Computer Science, which has evolved from three disciplines: mathematics, engineering and linguistics.  ','Automata Theory, Formal Languages and Computational Complexity',3,2,12),(1519,'CMPILER','This course introduces the theories, formal techniques, design, and implementation considerations in the construction of interpreters, compilers, and language translators in general.','Compiler Theory',3,2,12),(1520,'BASICON','This course provides an overview of computers, number systems, data types and representations, digital logic systems, assembly and machine language, compilers and translators, operating systems, internet working, human computer interactions, and intelligent systems.','Basic Computer Concepts',3,2,10),(1521,'DIGIDES','This course provides an overview of the principles underlying number systems and representation, logic gates, Boolean algebra, simplification of Boolean functions, and basic operation of combinational and sequential logic circuits.','Digital Design',3,2,10),(1522,'NETWORK','This course introduces the student to the basic concepts of computer networking. The seven layered ISO-OSI reference model for computer networks, using TCP/IP and other current networking standards as an example.','Network ',3,2,11),(1523,'ARCHORG','This course provides an overview of Instruction Set Architecture through assembly language programming and the interaction between basic computer system components, namely the CPU, Memory, and I/O.','Computer Architecture and Organization',3,2,10),(1524,'OPERSYS','This is an introductory course to operating system design and implementation. This course will cover basic algorithms and procedures to CPU scheduling and memory management. This course will also introduce students to basic concepts of writing concurrent processes and basic techniques to synchronize processes.','Introduction to Operating Systems',3,2,12),(1525,'ST-STAT','This course covers simulation, which refers to a broad collection of methods to mimic the behavior of real systems. The main focus of this course is on building logical or mathematical models of systems and analyzing these models. Different types of simulation models such as Static, Dynamic, Continuous, Discrete, Deterministic and Stochastic models are discussed. This course also covers mathematical preliminaries to simulation such as pseudo-random number generation and an introduction to probability and statistics, which provide essential tools for conducting meaningful simulation.','Statistics and Probability for ST',3,5,26),(1526,'ADVSTAT','This course covers topics in advanced statistics and probability, including joint probability distribution, F-distribution, sampling distribution, chi-square distribution, and analysis of variance. Topics on numerical methods are also introduced, including continuous and discrete functions, non-linear equations, quadratic and cubic functions, interpolation, and regression techniques. ','Advanced Statistics and Probability for ST',3,5,26),(1527,'CSETHIC','None','CS Professional Ethics',3,2,12),(1528,'SCIMATB','This is a course designed to help students appreciate and understand this exciting field by guiding them through the scientific underpinnings of modern biotechnology, giving them a grasp of the basic concepts and principles, and enabling them to be at pace with this rapidly evolving technology. This is brought about by the recent progress and cutting-edge breakthroughs in the field of biotechnology which have revolutionized our understanding of life processes and have led to innovations, practical applications and improvement in the ways by which we utilize living organisms to meet human needs.','G.E. Natural Science New Materials Track- BIO LEC',1,5,24),(1529,'LBYMATB','This is a laboratory course designed to help students appreciate and understand this exciting field by guiding them through the scientific underpinnings of modern biotechnology, giving them a grasp of the basic concepts and principles, and enabling them to be at pace with this rapidly evolving technology. This is brought about by the recent progress and cutting-edge breakthroughs in the field of biotechnology which have revolutionized our understanding of life processes and have led to innovations, practical applications, and improvement in the ways by which we utilize living organisms to meet human needs.','G.E. Natural Science New Materials Track- CHEM LAB',1,5,24),(1530,'FITWELL','This course is an introductory course that focuses on our rich culture and cherished values. It enables this generation to enjoy the country’s games that developed the character and molded the values and beliefs of the young many decades ago. Game originations, modifications over time, special equipment, terminologies, and background information are given focus. Students are assessed on their ability to apply skills, strategies, rules and conventions of play while safely participating and enjoying and showing appropriate social behavior.','Physical Fitness and Wellness ',2,1,8),(1532,'FTDANCE','This course is a basic course intended principally for students without previous dance experience. Students will be introduced to the basic fundamentals of partnership dancing. It includes basic dance steps and dance fundamentals needed to learn selected ballroom dances with emphasis on basic dance steps, rhythm, and technique. Young dancers are introduced through ballroom dance FINALE that will enhance their sense of rhythm, coordination, and confidence on the dance floor.','Physical Fitness and Wellness in Dance (Ballroom Dancing) ',2,1,8),(1531,'FTSPORT','This course is a soft pre-requisite course to all the succeeding Physical Education sports and rhythm activities. Every student will submit to the rigors and protocol of each Health-related fitness test components. Test results will help students understand their current fitness status, identify the risk, empower them to take responsibility for lifestyle decision, and inspire them to embrace the opportunity to make positive lifestyle choices. Each fitness component will be discussed every meeting to enlighten students on the facts, issues, controversies, and myths surrounding each topic. Active participation in the mastery of the aerobic mass demo routine and creation for the presentation of a creative aerobic routine from the basic rhythmic step patterns in the inter-class competition is required.','Physical Fitness and Wellness in Individual Sports (Philippine Games) ',2,1,8),(1533,'FTTEAMS','This course is a basic course in basketball that equips students with the necessary skills needed to become an offensive/defensive team member in basketball. This course further develops fundamental skills learned in basketball through awareness of movement/actions and factors that influence a player to move intelligently and safely on the court. Application of discipline-specific, scientific, and theoretical concepts critical to the development of strategies, techniques, and the use of proper body mechanics will be strictly observed through safety performance while actively participating in drills/activities in order to become well informed and engaged basketball players.','Physical Fitness and Wellness in Team Sports (Basketball) ',2,1,8),(1534,'PERSEF1','The Lasallian Core Curriculum of the DLSU–Manila aims at developing a whole person who embodies the Lasallian values and demonstrates professional skills as well as personal competencies. This individual is mature in all aspects of his/her person, with a nationalistic and humanistic outlook and a carefully reasoned faith.   PERSEF1 is a foundational course in the Lasallian Core Curriculum, taken by all students in their first year. It provides the information and skills that they need as they blend into college life. The course covers basic topics in each of the 5 themes of total personal development, designed to complement their academic and spiritual growth. These themes will be further explored in the 2 other Personal Effectiveness courses which the students will take in later years.','Personal Effectiveness 1',2,1,7),(1535,'PERSEF2','The Lasallian Core Curriculum of the DLSU–Manila aims at developing a whole person who embodies the Lasallian values and demonstrates professional skills as well as personal competencies. This individual is mature in all aspects of his/her person, with a nationalistic and humanistic outlook and a carefully reasoned faith.   PERSEF2 is a formative course in the Lasallian Core Curriculum, taken by students in their 2nd or 3rd year, before they take their practicum courses. It focuses on their preparation for entry into the world of work. It is based on the theory that career is a developmental process that starts in childhood and goes on through life. One’s career development is thus affected by, and affects, one’s physical, socio–psychological, spiritual and cognitive development. The topics of the various sessions revolve around the same 5 themes of total personal development, which were covered in PERSEF1, but take on a different level with emphasis on career development.','Personal Effectiveness 2 ',2,1,7),(1536,'IPERSEF','This course integrates what the students have learned and internalized during the first and second personal effectiveness courses.','Integrating Course for Personal Effectiveness ',0,1,7),(1537,'FILKOMU','The course focuses on the more advanced use of the Filipino language in discussing the five macro discourses of Philippine Studies which have been designed for an individual to know and understand oneself and appreciate one’s national identity, culture, and society. The general objective of the course is for every Lasallian student to acquire competence in communication in the five discourses of Filipinology in an academic context.','Komunikasyon sa Filipinohiya',3,4,16),(1538,'FILDLAR','The course focuses on the development of the analytical and critical skills of the students in reading and writing for academic and professional communication requirements with consideration of other language register. Students are taught the different paraphrasing techniques and reading strategies that go beyond literal translation through the use of written textual genre (as well as audio/visual) or from various language usage in the fields of humanities, social science and communication, science and technology, and the profession. To serve as models are various reading materials on how to conduct research papers and other scholarly essays.','Pagbasa at Pagsulat sa Iba’t-ibang Disiplina ',3,4,16),(1579,'FORMDEV','This course introduces the students to the life of St. La Salle and the early life of the Brothers of the Christians Schools, and assists them in relating these to their lives.','Formation and Development',0.5,2,12),(1540,'ENGLCOM','ENGLCOM (Basic Communication and Study Skills) English one is a course that primarily focuses on the development of communicative competence in reading and writing. ENGLONE will use various strategies in academic reading, and the process approach to academic writing. Evaluation will include traditional and nontraditional (portfolio assessment) methods.','Basic Communication and Study Skills',3,4,15),(1541,'SPEECOM','This course is an English for Specific Purposes (ESP) course that focuses on the production, delivery, and assessment of the following oral presentations: the impromptu, lecture and/or persuasive speech for individual presentation, and the panel discussion for group presentation. The presentations aim at providing students first-hand experiences in public speaking to develop their self-confidence and critical thinking in oral presentations addressing relevant social issues.','Oral Communication/Advanced Speech Class ',3,4,15),(1542,'ENGLRES','This course aims to teach students to apply reading and writing skills necessary in conducting research. It also enhances the critical thinking skills required in academic research writing/communication of a particular field (Business, Computer Science, Liberal Arts, Education, Science, and Engineering).','English for Academic Purposes ',3,4,19),(1543,'INOVATE','This course is on managing technology and innovation for survival and growth in challenging times. Students will learn how to develop corporate strategies and understand current practices in innovation management. They will also devise innovation approaches that integrate design, marketing and production perspectives, and combine technology and business models.','Technology and Innovation Management',3,2,12),(1544,'INTFILO','Philosophy, both as a way of life and an academic discipline, examines and understands the fundamental questions about the world and human life, seeks answers to these questions, and applies the answers to daily living. It also examines the basis upon which beliefs are held, and explodes possible interconnections among various fields of knowledge. This course shall introduce students to the ideas of some of the world’s greatest philosophers, which have shaped the way in which human beings think and live. Consequently, this foundational philosophy course shall hone their skills in philosophical reasoning.','Introductory Philosophy ',3,4,22),(1545,'KASPIL1','This is a foundational course. The critical study and review of the life, writings, and achievements of Dr. Jose Rizal is a historical examination. The course also discusses the Spanish colonialism in the Philippines with emphasis in the 19th century during the time of Dr. Jose Rizal. The course is in compliance with the provisions set forth in the Rizal Law (R.A 1425, 1956) that aims to respond to the need of engendering and strengthening the spirit of nationalism in the life of the student.','Buhay, Mga Sinulat, At Nagawa ni Dr. Jose Rizal ',3,4,16),(1546,'KASPIL2','This course is a critical study of the history of the Philippines and its political, economic, social and cultural institutions from its birth up to the present as viewed under a Filipino perspective. This course discusses the development of the nation and the challenges that if faced at every significant chapter of its history. The course aims to inculcate in students the lessons learned from history and how these lessons can provide solution to the issues presently confronting the country.','Kasaysayan ng Pilipinas ',3,4,16),(1547,'LASARE1','This one-day recollection for first year students focuses on the development of the Lasallian core values of faith, zeal for service, and communion in mission among the participants. Using passages from the Sacred Scriptures and references to the Lasallian founding story, LASARE1 invites each of the participants to (1) recognize and appreciate their inherent goodness and giftedness in the context of being created in the image and likeness of God, (2) explore ways by which they can enhance and share their gifts to their respective communities, and (3) identify a concrete community service project by which they can actualize the value or working together in a mission to serve those in need. The synthesizing point for all the activities of this one-day recollection is the call to be “Ambassadors of God” or to be the visible signs of faith, hope, and God’s love in this world.','Lasallian Recollection 1 ',0,4,23),(1548,'LASARE2','LASARE2 is a one–day recollection for second year students which intends to deepen the Lasallian Core Values of Faith, Zeal for Service and Communion in Mission among the participants by helping them become more aware of their calling. The program will provide an opportunity for the participants to understand what “calling” is and its principles; to be moved to respond to the greater reality beyond them; to identify their gifts and passions that will enable them to respond to their calling; and to express in writing how God is calling them in their present reality. At the end of the recollection, the participants are challenged to make their individual “mission statement” or a definition of their “life’s work” which manifests how they have integrated the Lasallian Core Values in their lives.','Lasallian Recollection 2',0,4,23),(1549,'LASARE3','The Integrating Lasallian Retreat (LASARET) is an overnight off-campus spiritual development activity for graduating students, aimed at nurturing in them a deep sense of purpose and mission. The retreat hopes that the students will be able to identify possible contributions and personal responses to the Gospel invitation of building God’s Kingdom or to the Lasallian vision of forming “Achievers for God and Country.”','Lasallian Recollection 3',0,4,23),(1550,'HUMAART','This course is an introduction to the elements and principles of art (music, dance, architecture, sculpture, painting, and film) through a critical examination of the major art works, movements and styles in the Philippines and the world. It is principally a study of arts as processes of the creative imagination in dynamic interaction with its multi-faceted worlds.  To enable the students to appreciate the arts, the course will foreground the study of the arts and their elements on a story of how the basic human impetus to express oneself in enduring forms of beauty is born out of the struggle of the spirit on the day-to-day level. The arts provide the tangible and intangible examples of the magnificence of the human spirit which ennoble the mind and the heart of the beholder. And it is one’s awareness of the monuments of the human spirit’s magnificence that opens the way for a student’s life-long and deepening intimacy with the arts.','Introduction to Art ',3,4,19),(1551,'HUMALIT','Introduction to Literature is a foundational course that introduces students to literary forms of genres (fiction, poetry, drama) through the study of selected literary texts from various countries and historical periods. Students will be guided through the development of a personal framework for the analysis, appreciation, and assessment of literature','Introduction to Literature',3,4,19),(1552,'NSTP101','This non-academic course introduces the student to the general overview of the NSTP and CWTS, whose goals are to encourage the student/youth to contribute in nation building and in the improvement of the general welfare and the quality of life of local marginalized communities.','NSTP General Orientation ',0,9,42),(1553,'NSTP-01','This non-academic course focuses in training and developing the NROTC cadets for incorporation into the Naval Reserve Force. Specifically, this course aims to indoctrinate and equip ROTC Cadet with: the basic knowledge on fundamentals and principles of military service, skills to move, shoot and communicate, and the right attitude of a military professional.','NSTP Community Service/ROTC 1',3,9,42),(1555,'NSTP-02','The NSTPCW2 is the second and final phase of the CWTS component of NSTP. Under CW2, students are given the opportunity to implement projects in partnership with local marginalized and deprived communities by way of actual community work through implementation and completion of short-term projects (e.g. literacy, resource mobilization, advocacy) that will benefit a partner community. The student is expected to submit term-end community project report.','NSTP Community Service/ROTC 2',3,9,42),(1572,'SOCTEC1','Science, Technology, and Society 1 (SOCTEC 1) is a social science course designed for students of the Colleges of Computer Studies, Engineering, and Science. It uses social science perspectives to examine the nature, emergence, and progress of scientific and technological knowledge and practice. The course focuses on the interface between science and technology on the one hand and human society and culture on the other. Specifically, it shows how science emerges and develops as a response to the various problems and demands of society and how the practice of science is shaped by the social, cultural, political, and economic aspects of society. To be discussed in the course are current issues about science, technology, and society that are relevant to the students’ majors (natural and physical sciences, engineering, and computer science).','Science, Technology, and Society 1',3,2,12),(1557,'TREDONE','This course develops in students the skills for religious respect and tolerance, dialogue and unity, as they open themselves into inter-religious and ecumenical dialogue. This dialogue and sharing of spiritual gifts from the great traditions in turn show the way to promoting justice, peace, and integrity of creation.   In this course, the students discern the role that faith plays in their lives as they grapple with the questions and concerns on the meaning of life. As the course looks at the distinctiveness of Christianity and its different faith expressions, students are led to discover and critically appreciate the life-giving roots exemplified in their own beliefs, norms, and rituals. They deepen their understanding of the meaning of life by recognizing the truth, goodness, and beauty found in the different religious traditions.','Humanity’s Search for Life ',3,4,23),(1558,'TREDTWO','This course develops students as persons in communities of moral discernment. The Filipino-Christian living in a rapidly changing world is confronted with challenges and alternative lifestyles which demand proper discernment, evaluation, and decision.','The Filipino Christian in a Changing World ',3,4,23),(1559,'TREDTRI','The course is a journey into Sacred Scriptures as a locus of encounter with JESUS, THE LIVING WORD. The students read and reflect on the bible as God’s revelation or personal communication, develop the skills in biblical analysis and personally reflect on the life of Jesus. The course empowers the students to live and promote the Gospel values of justice, peace, and care of creation in their lives and in their communities. Concretely, students immerse into communities in need of help in the catechetical ministry.','The Christian and the Word ',3,4,23),(1560,'TREDFOR','The course develops in the student the disposition and knowledge in discerning Christian life as a response of faith to the invitation to an unconditional offer of life and love (the Kingdom of God). The course focuses on marriage and family life as a response and commitment to follow Jesus. After exploring God’s call as vocation in Module 1, its implication for the marital commitment will be discussed in Modules 2 and 3. The characteristics, relational means of the marital commitment, and the meaning of being and becoming family will be treated in Module 4. Priesthood, religious life, and single life will also be discussed in Module 5 as other ways of responding to God’s call.','The Christian Vocation of Life',3,4,23),(1561,'STELEC1','None','ST Elective 1',3,2,12),(1562,'STELEC2','None','ST Elective 2',3,2,12),(1563,'STELEC3','None','ST Elective 3',3,2,12),(1564,'STELEC4','None','ST Elective 4',3,2,12),(1565,'SPELEC1','None','Special Elective 1',3,2,12),(1566,'SPELEC3','None','Special Elective 3',3,2,12),(1567,'SPELEC2','None','Special Elective 2',3,2,12),(1568,'SCIMATP','This is a General Education (GE) course on new materials used in modern technologies designed for students in the College of Computer Studies (CCS), College of Education (CED), College of Liberal Arts (CLA), College of Business, and School of Economics (SOE). The course provides the students with an insight on the structure, properties, processing, and performance of new materials. Misconceptions on the different topics will be drawn out, sorted, and resolved through the various hands-on activities and group discussion. The course utilizes the students’ imagination, intuition, and creativity in analyzing and discovering the various laws and principles that govern the physical world.','G.E. Natural Science New Materials Track – Physics ',2,5,27),(1569,'SCIMATC','This course is designed to provide an understanding of general chemical principle by following the current development in material sciences; plastics and polymers; synthesis, design and delivery of drugs; household products; food and nutrition; and genetic engineering. Chemical concepts that will be covered include atomic theory; bonding and polymerization; molecular geometry and isomerism; organic chemistry and functional groups; intermolecular forces of attraction; food components; carbohydrates, fats and proteins; caloric intake; and DNA and the chemistry of heredity.','G.E. Natural Science New Materials Track – Chemistry (Lecture) ',1,5,25),(1570,'LBYMATC','The laboratory component of SCIMATC will expand understanding of the lecture topics by providing the students with an experience of scientific knowledge acquisition. Activities include hands-on experiments, demonstrations and inter class debates.','G.E. Natural Science New Materials Track – Chemistry (Laboratory) ',1,5,25),(1571,'SAS1000','None','NSTP/CWTS General Meeting',0,9,42),(1573,'SOCTEC2','SOCTEC2 (Science, Technology and Society 2) Science, Technology and Society 2 is about the influence and consequences of science and technology on various aspects of society, such as the environment, the economy, modernization and globalization, social and power relations, and governance.','Science, Technology, and Society 2',3,2,12),(1574,'STMETRE','A course on methods of research where students learn the steps on how to do a research project; a thesis proposal should be produced at the end of the course.','Software Technology Research Methods',2,2,12),(1575,'THS-ST1','The undergraduate thesis is a non-classroom learning environment in which students may apply the skills, methods, and theories learned throughout their stay in the College of Computer Studies. THSST-1 involves the following activities: (a) search and review of related literature. (b) investigation of existing solutions to the identified problem(s) in STRESME. (c) evaluation of existing solutions. (d) application of methods and theories in the design of a solution to the problem(s).','Thesis in Software Technology 1 ',2,2,12),(1576,'THS-ST2','Entry into the THSST-2 stage requires a successful completion of all THSST-1 requirements and prerequisite courses as specified in the appropriate ST flowchart. This stage involves the implementation of major system functions in the target programming language and/or environment. The components are expected to perform the following activities: (a) development and implementation of the solution identified in THSST-1. (b) documentation of development and implementation issues. (c) regular consultation with the thesis adviser. (d) submission of a 6-page technical paper to be reviewed by the panelists and if accepted, participation in a public presentation in a duly organized symposium or congress by the College &/or University, or local/national conferences.','Thesis in Software Technology 2',2,2,12),(1577,'THS-ST3','During this stage, the proponents perform the following activities: (a) development of minor system functions (i.e online help, system enhancements). (b) system testing and analysis of test results. (c) documentation of testing activities and test results. (d) finalizing of the thesis deliverables (i.e. main document, technical manual, user’s manual, software). (e) preparation for the thesis defense.','Thesis in Software Technology 3',2,2,12),(1578,'GREATWK','The course is designed to center on a theme built around three Great Works from various cultures/disciplines that have exerted influence on the way human beings think about themselves in relation to the world. The course will be taught by a team of three teacher-facilitators who will rotate every four weeks in three classes. Each teacher will facilitate the reading and discussion of one work. Towards the end of the term, the teachers will meet as a team with all the students of the three classes in sessions that will serve to integrate the discussions on the three Great Works. Through the course, students are given a venue to participate in multidisciplinary discourses on how a particular Great Work \"reads\" or \"thinks through\" the human problems with new perspectives and paradigms.','Great Works',3,4,19),(1580,'ADVDISC','This course provides students with advanced theories on discrete structures and linear algebra. It covers topics on methods of proof, inductions, equivalence relations, solutions of equations, as well as matrices, vector spaces, and linear transformations.','Advanced Discrete Structures',3,2,12),(1581,'THEOCOM','This course concentrates on the theoretical aspect of Computer Science, which has evolved from three disciplines: mathematics, engineering and linguistics.  ','Automata Theory, Formal Languages and Computational Complexity',3,2,12),(1582,'COMPILE','This course introduces the theories, formal techniques, design, and implementation considerations in the construction of interpreters, compilers, and language translators in general.','Compiler Theory',3,2,12),(1583,'INTRPRG','This course provides students with the fundamentals of logic formulation and understanding of object-oriented technology. It introduces the different concepts that are commonly associated with object programming.','Introduction to Programming and Logic Formulation',3,2,12),(1584,'DASTRAP','In this course, the students will learn different data structures and algorithm analysis with a focus on how to create efficient data structures and algorithms. The course aims to train the students the ability to select or design the data structure that will best solve a given problem.','Applied Data Structures and Algorithms',3,2,12),(1585,'ADVPROG','This course introduces students to advance logic programming constructs in JAVA. Complementing existing knowledge of basic logic programming constructs and data structures, ADVPROG focuses on developing the abilities of students in developing advanced computing applications.','Advanced Programming',3,2,12),(1586,'COMALGO','This course covers the design and analysis of different algorithms under various design principles and techniques making use of different data structures.','Algorithm Complexity',3,2,12),(1587,'COMMAT1','This course covers the fundamentals of logic formulation together with their implementation in the C programming language. This course should serve as a foundation for future computer courses that the students will encounter.','Introduction to Computer Programming',3,2,12),(1588,'COMMAT2','This is an advanced course in computer programming using C++ programming language. The first part of the course discusses basic object-oriented constructs that all features of the C++ language. The second part of the course extends the application of the object-oriented programming to other abstract date types.','Computer for Mathematics 2',3,2,12),(1589,'COMMAT3','This computer programming course will explore the power of Java Language. A one hour lecture and two hour laboratory course which discuss user interfaces, object oriented programming, event handling, and graphic techniques.','Computer for Mathematics 3',3,2,12),(1590,'ADVANSE','This course will introduce students to the practices of a full spectrum of software development approaches and methods, from the more plan-driven, documentation-intensive approaches of PSP, TSP, and CMMI, to the more agile methods of XP and Scrum.','Advanced Software Engineering',3,2,12),(1591,'MOBIDEV','This course aims to expose the students to various wireless technologies and how they can be utilized to support different kinds of activities. It also aims to provide the students with the breadth of knowledge required to pursue further studies on the area.','Development of Mobile Applications',3,2,12),(1597,'3DMODEL','This course will discuss introductory topics on 3D computer graphics including modeling, material properties, lights, cameras, animation and rendering.','Introduction to 3D Computer Graphics and Animation',3,2,12),(1593,'DESPATT','This is an advanced programming course emphasizing object-oriented design. Design patterns are recurring solutions in designing systems and are considered simple yet elegant solutions which have been proven effective over time. The applications of these design patterns allow the creation of systems that are more scalable, reliable and effective. ','Design Patterns',3,2,12),(1594,'INTROAI','Artificial Intelligence (AI) is the study of how machines can exhibit at least one of the following aspects associated with intelligent behavior: (a) problem solving, or the performance of non-trivial, goal-directed cognitive tasks even in the face of inadequate (e.g., incomplete, incorrect, inconsistent, or vague) data; (b) reasoning, or the drawing of logical inferences and conclusions from possibly inadequate evidence; (c) learning, or the improvement of performance through experience; and (d) natural language processing. This 3.0-unit course introduces the CS-ST major to fundamental concepts, principles, and techniques in searchbased problem solving, reasoning, and machine learning, and in the representation of the knowledge needed to perform these tasks. ','Introduction to Artificial Intelligence ',3,2,12),(1596,'EMPATHY','This course introduces the pluridisciplinary perspectives on Empathic Computing, surveys the relevant related literatures and explores the design and methodology of existing stateof­the­art empathic intelligent systems, and investigates the compelling current issues and future trends.','EMPATHIC COMPUTING IN HUMAN­SYSTEM INTERACTION',3,2,12),(1600,'WEBPROG','This course introduces students to the theories, processes and skills needed in the development of web applications. It provides an overview of the various technologies used in designing and implementing web-based systems. Advanced topics are also included to prepare students in realizing useful web applications that utilize up-to-date industry tools.','Web Programming',3,2,12),(1599,'WEBDEVE','This course introduces students to the theories, processes and skills needed in the development of web applications. It provides an overview of the various technologies used in designing and implementing web-based systems. Advanced topics are also included to prepare students in realizing useful web applications that utilize up-to-date industry tools.','ST Web Applications Development',3,2,12),(1601,'DEV-WEB','This course introduces students to the theories, processes and skills needed in the development of web applications. It provides an overview of the various technologies used in designing and implementing web-based systems. Advanced topics are also included to prepare students in realizing useful web applications that utilize up-to-date industry tools.','Development Of Web Applications',3,2,12),(1602,'BISPROC','This course is designed for Information Technology and Communications Management students who need to have an overview of different generic business processes of various industries. The students are going to learn how to describe, analyze, diagnose, and redesign a business process through the study of robust Business Process Reengineering (BPR) methodologies and tools. In the business environment, redesigning a business process involves more than restructuring the workflow. It also involves changes in information flows, knowledge management capabilities, and total quality management skills. When a business reengineers its processes, it is vital for the employees to handle change. This is why the course is also going to cover the approaches in change management.','Organization and Business Processes',3,2,12),(1603,'ORGMGNT','ORGMGNT (Organization and Management Concepts) This course is an introduction to basic management concepts and the role of Information Technology in business organizations.','Organization and Management Concepts',3,2,12),(1605,'AN-MODE','This course introduces students to the different object-oriented diagrams used to model information systems functional, structural and behavioral components. Using a master-case driven lecture, students will get to appreciate the value and relationships of the different diagrams in communicating elements of the information system being analyzed.','SYSTEMS ANALYSIS AND DESIGN PROJECT',1,2,12),(1606,'COMMAT4','This course will look at some of the advanced features provided in the Java libraries, called APIs such as: networking, Swing, container data structures and RMI.','Computer for Mathematics',3,2,12),(1607,'INTROOS','This is an introductory course to operating system design and implementation. This course will cover basic algorithms and procedures to CPU scheduling and memory management. This course will also introduce students to basic concepts of writing concurrent processes and basic techniques to synchronize processes.','Introduction To Operating System',3,2,12),(1609,'TECHPRE','None','Technopreneurship',3,2,12),(1610,'MODESTA','This course covers simulation, which refers to a broad collection of methods to mimic the behavior of real systems. The main focus of this course is on building logical or mathematical models of systems and analyzing these models. Different types of simulation models such as Static, Dynamic, Continuous, Discrete, Deterministic and Stochastic models are discussed. This course also covers mathematical preliminaries to simulation such as pseudo-random number generation and an introduction to probability and statistics, which provide essential tools for conducting meaningful simulation.','Modeling, Simulation and Statistics',3,2,12),(1611,'INTROSE','This course provides an overview of software engineering as a discipline concerned with the application of theory, knowledge, and practice for effectively and efficiently building software systems. It introduces the students to the fundamental principles and methodologies of software engineering.  It focuses on the concepts and principles of software requirements engineering, its tools, techniques, and methods for modeling software systems. Various approaches to requirements analysis and review activities are examined.','Introduction to Software Engineering',3,2,12),(1612,'PROFSWD','The aim of this course is to prepare ST students for practicum and a career in software development by delivering actual knowledge and skills currently required by the industry. This is achieved through lectures from IT industry practitioners on the current trends and organizational practices that lead to producing software that is robust, reliable and attractive to use, often co-operating with others as part of a development team. ','Professional Software Development',3,2,12),(1613,'SPSWENG','This course provides an overview of software engineering as a discipline concerned with the application of theory, knowledge, and practice for effectively and efficiently building software systems. It introduces the students to the fundamental principles and methodologies of software engineering.  It focuses on the concepts and principles of software requirements engineering, its tools, techniques, and methods for modeling software systems. Various approaches to requirements analysis and review activities are examined.','Introduction to Software Engineering',3,2,12),(1614,'INTRNLP','None','Introduction to Natural Language Processing',3,2,12),(1615,'COMPRG1','This course covers the fundamentals of logic formulation and computer programming using the C programming language. It serves as a foundation for future courses that the students will encounter throughout the Computer Science program. This course is coupled with a lab component.','Introduction to Computer Programming 1',3,2,12),(1616,'COMPRG2','This advanced course for computer programming in C covers the representation and manipulation of C data structures. This course, like COMPRO1, serves as a foundation for future courses that the students will encounter throughout the Computer Science program. This course is coupled with a lab component.','Advanced Programming',3,2,12),(1623,'STRESME','A course on methods of research where students learn the steps on how to do a research project; a thesis proposal should be produced at the end of the course.','Software Technology Research Methods',3,2,12),(1624,'HCIFACE','This course provides an overview of software engineering as a discipline concerned with the application of theory, knowledge, and practice for effectively and efficiently building software systems. It introduces the students to the fundamental principles and methodologies of software engineering.  It focuses on the concepts and principles of software requirements engineering, its tools, techniques, and methods for modeling software systems. Various approaches to requirements analysis and review activities are examined.','Human-Computer Interface',3,2,12),(1618,'INTPRG2','This advanced course for computer programming in C covers the representation and manipulation of C data structures. This course, like COMPRO1, serves as a foundation for future courses that the students will encounter throughout the Computer Science program. This course is coupled with a lab component.','Introduction to Computer Programming 2',3,2,12),(1619,'CSRESEM','A course on methods of research where students learn the steps on how to do a research project; a thesis proposal should be produced at the end of the course.','Computer Science Research Method',3,2,12),(1620,'RESMETH','A course on methods of research where students learn the steps on how to do a research project; a thesis proposal should be produced at the end of the course.','Research Method',3,2,12),(1621,'OPERLAB','None','Operating Systems Lab',3,2,12),(1622,'TECHGOV','None','Technology Governance',3,2,12),(1625,'COMPORG','This course provides an overview of Instruction Set Architecture through assembly language programming and the interaction between basic computer system components, namely the CPU, Memory, and I/O.','Computer Architecture and Organization',3,2,12),(1627,'DIGILOG','This course provides a discussion of digital logic, specifically on boolean algebra, simplification of boolean functions, logic gates, and basic operation of combinational and sequential logic circuits.','Digital Logic',3,2,10),(1628,'NTCOR01','The course introduces students to fundamental networking concepts and technologies. It includes discussion on application of computer networks such as transmission of video, audio, and voice. The course materials assist students in developing the skills necessary to plan and implement small networks across a range of applications.','Networking Basic',3,2,10),(1629,'COMPASM','This is a lecture course on Assembly language programming and the supplementary introduction on interfacing assembly code with C language programs.','Computer Programming in Assembly Language',3,2,10),(1630,'LBYNT01','This course covers basic networking topics that allow the student to design and implement SOHO networks. Topics include the two networking models (OSI and TCP/IP) as well as basic Cisco CLI commands to perform bsic router and switch configuration.','Networking Basic Laboratory',1,2,10),(1631,'WEB-PRG','This course introduces students to the theories, processes and skills needed in the development of web applications. It provides an overview of the various technologies used in designing and implementing web-based systems. Advanced topics are also included to prepare students in realizing useful web applications that utilize up-to-date industry tools.','Web Programming',3,2,12),(1642,'NECOR02','The primary focus of this course is on routers and routing protocols. It includes discussion on different issues involved in the transmission of information among routers in order to determine the best path data packets can take. This course includes discussion and lab activities on both static routing and dynamic routing protocols.','Routing and Switching Fundamentals (Lecture)',3,2,10),(1640,'HCK-LCT','The course introduces students to fundamental networking concepts and technologies. It includes discussion on application of computer networks such as transmission of video, audio, and voice. The course materials assist students in developing the skills necessary to plan and implement small networks across a range of applications.','Lecture on Ethical Hacking Countermeasures',3,2,10),(1635,'NECOR01','The course introduces students to fundamental networking concepts and technologies. It includes discussion on application of computer networks such as transmission of video, audio, and voice. The course materials assist students in developing the skills necessary to plan and implement small networks across a range of applications.','Introduction to Networks (Lecture)',3,2,10),(1641,'LBYNE02','This course covers topics on routers and routing basics. This includes router configuration and troubleshooting, IOS management, distance vector routing, and access control lists.','Routing and Switching Fundamentals (Laboratory)',1,2,10),(1637,'LBYNE01','This course covers basic networking topics that allow the student to design and implement SOHO networks. Topics include the two networking models (OSI and TCP/IP) as well as basic Cisco CLI commands to perform bsic router and switch configuration.','Introduction to Networks (Laboratory)',1,2,10),(1639,'LBY-HCK','This is the laboratory component of HACKLEC. This covers laboratory activities that allows students to understand footprinting, scanning, enumeration, system hacking, trojan and backdoors, sniffers, denial of service, and web application vulnerabilities.','Laboratory on Ethical Hacking Countermeasures',1,2,10),(1643,'COMORGA','This course covers design considerations for implementing components of the von neumann computer, namely, the central processing unit, memory and I/O peripherals.','Computer Organization',3,2,10),(1644,'NECOR03','This course covers the basics of LAN switching and its design and implementation for interconnecting computers or other computing devices. It includes different concepts in switching such as VLANs and spanning tree that help a switched network to be more efficient and fault-tolerant. It also covers introductory concepts on wireless technology.','Advanced Routing and Switching (Lecture)',3,2,10),(1645,'LBYNE03','This course focuses on advanced IP addressing techniques (variable length subnet masking), intermediate routing protocols, CLI configuration of switches, Ethernet switching, Virtual LANs, Spanning Tree Protocols, and VLAN Trunking Protocols.','Advanced Routing and Switching (Laboratory)',1,2,10),(1646,'FORENSC','This course provides students with the necessary knowledge to identify the footprints left by intruders of computer and network systems. It includes discussion on properly handling evidences to prosecute as well as cyber laws applicable in different countries.','Computer Forensic',3,2,10),(1647,'LBYFORE','This course is the laboratory component of computer forensics. In this course, students perform activities that allow them to identify footprints left by intruders of computer and network systems. It also includes activities on properly handling computer-based evidences.','Computer Forensic Laboratory',1,2,10),(1648,'NECOR04','The course focuses on advanced IP addressing techniques, WAN technology and terminology, PPP, ISDN, DDR, Frame Relay, network management, introduction to optional networking. Advantages and disadvantages of each WAN solution is discussed in this course.','WAN Solutions',3,2,10),(1649,'LBYNE04','The course focuses on advanced IP addressing techniques, WAN technology and terminology, PPP, ISDN, DDR, Frame Relay, network management, introduction to optional networking. Advantages and disadvantages of each WAN solution is discussed in this course.','WAN Solutions (Laboratory)',1,2,10),(1650,'SECPROG','This course provides basic foundation in developing applications that have reduced security risks. It includes best practices in application development that allows the creation of .NET/Java-based applications while mitigating software vulnerabilities such as buffer overflow and hijacking.','Secure Programming',3,2,10),(1651,'LBYSPRG','This course is the laboratory component of secure programming. In this course, students develop applications that have reduced security risks. It includes activities that allow students to create .NET/Java-based applications while mitigating software vulnerabilities such as buffer overflow and hijacking.','Secure Programming (Laboratory)',1,2,10),(1652,'COMPARC','This course covers design issues of computer architecture specifically on pipeline and instruction set design.','Computer Architecture',3,2,10),(1653,'SYST-AD','This course provides a basic foundation on system administration. It includes discussion of various network operating systems and utilities that allow management and monitoring of resources such as user accounts, servers, workstations, and storage devices.','Systems Administration',3,2,10),(1654,'NEELEC1','None','Network Engineering Elective 1',3,2,12),(1655,'NEELEC2','None','Network Engineering Elective 2',3,2,12),(1656,'NEELEC3','None','Network Engineering Elective 3',3,2,12),(1657,'NEELEC4','None','Network Engineering Elective 4',3,2,12),(1658,'NERESEM','This is an introductory course for the CT Thesis Program, which illustrates how much Network Engineering (NE) students have understood and learned the theories, concepts, tools, and methodologies of Computer Science, and how he/she applies these to specific problem-solving situation','NE Research Methods',2,2,12),(1659,'PRCT-NE','On-the-job training course during the summer period of the junior year.','NE Practicum',1,2,10),(1660,'THSNE-1','In this course, the thesis group presents the design of the system which is defined through the research objectives, scope and limitation.','Thesis for Network Engineering 1',2,2,10),(1661,'SECURAD','This course provides a basic foundation on security administration. It includes discussion of various security tools and appliances such as vulnerability scanners, firewalls, intrusion detection and prevention systems, and VPN gateways.','Security Administration',3,2,12),(1662,'THSNE-2','This course is the second stage of the thesis program for NE students. In this course, an enrolled thesis group will be submitting a conference paper containing a substantial portion of their research, for review and approval by the designated thesis committee/panel.','Thesis for Network Engineering 2',2,2,10),(1665,'THSNE-3','This course is the final stage of the thesis program for NE students. In this course, enrolled thesis groups will be defending the 