651D','None','None',3,2,12),(1834,'EMPHCOM','This course introduces the pluridisciplinary perspectives on Empathic Computing, surveys the relevant related literatures and explores the design and methodology of existing stateof­the­art empathic intelligent systems, and investigates the compelling current issues and future trends.','EMPATHIC COMPUTING IN HUMAN­SYSTEM INTERACTION',3,2,12),(1866,'DIGITAL','This Course is on the design and analysis of digital circuits. This course covers both combinational and sequential (synchronous and asynchronous) logic circuits with emphasis on solving digital problems using hardwired structures of the complexity of medium and large-scale integration.','Digital Electronics',3,2,10),(1865,'LBYDIGT','The laboratory experiments in this subject are designed to supplement concepts presented in the course DIGITAL','Laboratory for Digital Design',1,2,10),(1858,'LBYNTAN','The laboratory experiments in this subject are designed to supplement concepts presented in the course NTANALY','Laboratory for AC/DC Network Analysis',1,2,10),(1859,'NTANALY','This course introduces the basic electrical circuit sources and components. The major methods of network analysis are discussed and compared with the help of numerous sample problems based on real-world applications.','AC/DC Network Analysis',3,2,10),(1861,'ELEC-01','None','Fundamentals of Electronics and Circuits (Lecture)',3,2,10),(1862,'LBYELC1','None','Fundamentals of Electronics and Circuits (Laboratory)',1,2,10),(1867,'ELEC-02','None','Linear Electronics and Comm Systems (Lecture)',3,2,10),(1868,'LBYELC2','None','Linear Electronics and Comm Systems (Laboratory)',1,2,10),(1870,'MICPRO1','This course is an introduction to small microprocessor-based systems with simple input/output concepts and peripherals. The course utilizes the Motorola M68HC11 microcontroller as the basic microprocessor, and also focuses on the peripheral functions integrated into the microcontroller. Lecture are complemented with weekly laboratory meeting to provide much-needed hands-on experience for the student','Microprocessor/Microcontroller Technology 1 (Lecture)',3,2,10),(1872,'LBYMIC1','The laboratory experiments in this subject are designed to supplement concepts presented in the course LBYMCP1','Microprocessor/Microcontroller Technology 1 (Laboratory)',1,2,10),(1873,'CT-MATH','This course covers background mathematical skills for computer systems design, and engineering.','Mathematics for CSE/NE',3,2,10),(1874,'CT-NEWT','None','Computer Networks and Data Communications',3,2,10),(1875,'BASCDSP','This course covers the fundamental concepts and practical applications of Digital Signal Processing.','Basic Digital Signal Processing',3,2,10),(1876,'MICPRO2','This course presents advanced topics in microprocessor technology focusing on the PC architecture, including direct memory access, advanced memory technology, and industry-standard interfaces.','Microprocessor/Microcontroller Technology 2 (Lecture)',3,2,10),(1877,'LBYMIC2','The laboratory experiments in this subject are designed to supplement concepts presented in the course LBYMCP2','Microprocessor/Microcontroller Technology 2 (Laboratory)',1,2,10),(1878,'FBKCTRL','This course covers classical techniques for designing continuous-time feedback control systems. It covers system modeling, analysis, as well as compensation. Analysis of stability of feedback systems using root-locus, bode diagrams, nyquist plots, as well as the use of computer-aided design tools are also discussed. ','Introduction to Feedback Control Systems',3,2,10),(1879,'CTRESME','A course on methods of research where students learn the steps on how to do a research projects; a thesis proposal should be produced at the end of the course.','Computer Systems Engineering Research Methods',2,2,10),(1880,'PRCTCSE','On-the-job training course during the summer period of the junior year.','Practicum for CSE Students',1,2,10),(1881,'SYSQUAR','None','Systems Quality Control (Lecture)',3,2,10),(1882,'LBYSYSQ','None','Systems Quality Control (Laboratory)',1,2,10),(1883,'THSCE-1','In this course, the thesis group presents the design of the system which is defined through the research objectives, scope and limitation.','Computer Systems Engineering Thesis 1',2,2,10),(1884,'THSCE-2','This course is the second stage of the thesis program for CSE students. In this course, an enrolled thesis group will be submitting a conference paper containing a substantial portion of their research, for review and approval by the designated thesis committee/panel.','Computer Systems Engineering Thesis 2',2,2,10),(1885,'THSCE-3','This course is the final stage of the thesis program for CSE students. In this course, enrolled thesis groups will be defending the final design and implementation of their system prototypes satisfying the objectives defined in their thesis proposal stage.','Computer Systems Engineering Thesis 3',2,2,10),(1886,'CSELEC1','Various courses allowing the students to specialize in a particular field of interest connected with computer systems engineering; choices of electives vary such as electronic circuit design, PIC microcontroller and application, fundamental of mobile robot, digital image processing, compression algorithm and techniques, real-time DSP, speech processing.','Computer Systems Engineering Elective 1',3,2,10),(1887,'CSELEC2','Various courses allowing the students to specialize in a particular field of interest connected with computer systems engineering; choices of electives vary such as electronic circuit design, PIC microcontroller and application, fundamental of mobile robot, digital image processing, compression algorithm and techniques, real-time DSP, speech processing.','Computer Systems Engineering Elective 2',3,2,10),(1888,'CSELEC3','Various courses allowing the students to specialize in a particular field of interest connected with computer systems engineering; choices of electives vary such as electronic circuit design, PIC microcontroller and application, fundamental of mobile robot, digital image processing, compression algorithm and techniques, real-time DSP, speech processing.','Computer Systems Engineering Elective 3',3,2,10),(1889,'CSELEC4','Various courses allowing the students to specialize in a particular field of interest connected with computer systems engineering; choices of electives vary such as electronic circuit design, PIC microcontroller and application, fundamental of mobile robot, digital image processing, compression algorithm and techniques, real-time DSP, speech processing.','Computer Systems Engineering Elective 4',3,2,10);
